import { useEffect, useState } from 'react';
import { VStack, Input, Button, Heading, Text, Link, useToast, FormControl, Icon, IconButton, Box, Divider, Flex } from '@chakra-ui/react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import { FcGoogle } from "react-icons/fc";
const Login = () => {
    const toast = useToast();
    const navigate = useNavigate();

    const [formData, setFormData] = useState({
        username: '',
        password: ''
    });

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value,
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            console.log(formData);
            const response = await axios.post('http://localhost:8000/api/login/', formData);
            console.log(response.data);
            localStorage.setItem("access", response.data.access)
            localStorage.setItem("refresh", response.data.refresh)
            localStorage.setItem("id", response.data.id)
            navigate(`/dashboard/${response.data.id}`);
        } catch (error) {
            console.log(error);
            toast({
                title: '',
                description: 'Login Failed',
                status: 'error',
                variant: 'left-accent',
                duration: 4000,
                isClosable: true,
                position: 'bottom'
            })
        }
    };
    const googleLogIn = async (e) => {
        try {
            console.log('hjgj');
            window.location.href = 'https://accounts.google.com/o/oauth2/v2/auth/oauthchooseaccount?client_id=85727582695-dcak32bv4mg84ejbm4ppig1jhn3ii7h5.apps.googleusercontent.com&redirect_uri=http%3A%2F%2F127.0.0.1%3A8000%2Faccounts%2Fgoogle%2Flogin%2Fcallback%2F&scope=profile%20email&response_type=code&state=xPVAbMuJIcAMV6mQ&access_type=online&service=lso&o2v=2&theme=glif&flowName=GeneralOAuthFlow';
        } catch (error) {
            // Handle errors
            console.error('Google login failed:', error.response ? error.response.data : error.message);
        }
    }

    useEffect(() => {
        const userToken = localStorage.getItem('access');
        const id = localStorage.getItem('id');
        if (userToken || id) {
            navigate(`/dashboard/${id}`);
        }
    }, []);

    return (
        <>
            <VStack
                as="form"
                onSubmit={handleSubmit}
                spacing={4}
                align="stretch"
                maxW="400px"
                mx="auto"
                p={8}
                borderWidth={1}
                borderRadius="lg"
                boxShadow="lg"
            >
                <Heading as="h3" size="lg" mb={4} textAlign={'center'}>
                    Login
                </Heading>
                <FormControl>
                    <Input
                        type="username"
                        placeholder="Enter username"
                        name="username"
                        value={formData.username}
                        onChange={handleChange}
                        required
                    />
                </FormControl>
                <FormControl>
                    <Input
                        type="password"
                        placeholder="Enter password"
                        name="password"
                        value={formData.password}
                        onChange={handleChange}
                    />
                </FormControl>
                <Button type="submit" colorScheme="teal" variant="solid">
                    Login
                </Button>
                <Flex alignItems='center'>
                    <Divider flex="1" borderColor="#d5d9e0" />
                    <Text mx={'10px'} color='#d5d9e0' fontSize="sm">
                        or login with
                    </Text>
                    <Divider flex="1" borderColor="#d5d9e0" />
                </Flex>
                <Button
                    width="50%"
                    colorScheme='green'
                    variant='outline'
                    onClick={googleLogIn}
                ><Link to="https://accounts.google.com/o/oauth2/v2/auth/oauthchooseaccount?client_id=85727582695-dcak32bv4mg84ejbm4ppig1jhn3ii7h5.apps.googleusercontent.com&redirect_uri=http%3A%2F%2F127.0.0.1%3A8000%2Faccounts%2Fgoogle%2Flogin%2Fcallback%2F&scope=profile%20email&response_type=code&state=xPVAbMuJIcAMV6mQ&access_type=online&service=lso&o2v=2&theme=glif&flowName=GeneralOAuthFlow">
                        <Icon as={FcGoogle} aria-label="Google Icon" boxSize={6} mr={2} />
                        <Text textColor='green'>Google</Text></Link>
                </Button>
                <Text fontSize="sm" textAlign="right" mt={2}>
                    Not registered yet? <Link href="/signup">Sign up</Link>
                </Text>
            </VStack ></>
    );
};

export default Login;
